import { Col, Container, Row, Table } from "react-bootstrap";

const Fixtures = () => {
  return (
    <Container fluid>
      <Row>
        <Col md={6}>
          <span>League</span>
        </Col>
      </Row>
    </Container>
  );
};
export default Fixtures;
